import React,{useEffect} from "react";
import { useParams } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import img from "../../img/perro2.jpg";
import S from "./Detail.module.css";
const Detail = () => {
  const { id } = useParams();
  

  return (
    <div className={S.box}>
      <div className={S.container}>
        <h1 className={S.title}>Name of breed</h1>
        <h2>{`Height : 12-33`}</h2>
        <h2>{`Weight : 1-3`}</h2>
        <h2>{`life span : 10- 15 years`}</h2>
        <p>temperaments : puto, jode, muerde, odia, racista, clasista, narco</p>
        <img className={S.img} src={img} alt="hola " />
      </div>
    </div>
  );
};

export default Detail;
